function TeaItem() {
    return (
        <div className="block teaItems">
            <h2>Tea Items</h2>
            <Row gutter = {24}>
                <Col lg = {4}>
                    <div className = "content">
                        <div className = "image">
                            <img />
                        </div>

                    </div>
                </Col>
            </Row>
        </div>
    )
}

export default TeaItem;
